import Aboutus from './../../containers/aboutus/Aboutus';

const Menu = () => (
    <>
    <p><a href="#gallery"> Gallery </a></p>
    <p><a href="#page"> Pricing </a></p>
    <p><a href="#contactus"> Contact Us </a></p>
    
    </>
)

// bem -> Block Element Modifier

